import Welcome from './simpleapp/welcome';
import { About,Vision,Mission } from './simpleapp/about';
import Contact from './simpleapp/about';


function Comp()
{
    
    return(
        <>
        
        <h1>Welcome all!</h1>
        <img src={image}></img>
        <Welcome></Welcome>
        <About></About>
        <Vision></Vision>
        <Mission></Mission>
        <Contact></Contact>
        </>

    )
}
export default Comp
